import React from "react";
import "../request/Request.scss";

const Request = () => {
  var current_fs, next_fs, previous_fs; //fieldsets
  var left, opacity, scale; //fieldset properties which we will animate
  var animating; //flag to prevent quick multi-click glitches

  $(".next").click(function () {
    if (animating) return false;
    animating = true;

    current_fs = $(this).parent();
    next_fs = $(this).parent().next();

    //activate next step on progressbar using the index of next_fs
    $("#progressbar li").eq($("fieldset").index(next_fs)).addClass("active");

    //show the next fieldset
    next_fs.show();
    //hide the current fieldset with style
    current_fs.animate(
      { opacity: 0 },
      {
        step: function (now, mx) {
          //as the opacity of current_fs reduces to 0 - stored in "now"
          //1. scale current_fs down to 80%
          scale = 1 - (1 - now) * 0.2;
          //2. bring next_fs from the right(50%)
          left = now * 50 + "%";
          //3. increase opacity of next_fs to 1 as it moves in
          opacity = 1 - now;
          current_fs.css({
            transform: "scale(" + scale + ")",
            position: "absolute",
          });
          next_fs.css({ left: left, opacity: opacity });
        },
        duration: 800,
        complete: function () {
          current_fs.hide();
          animating = false;
        },
        //this comes from the custom easing plugin
        easing: "easeInOutBack",
      }
    );
  });

  $(".previous").click(function () {
    if (animating) return false;
    animating = true;

    current_fs = $(this).parent();
    previous_fs = $(this).parent().prev();

    //de-activate current step on progressbar
    $("#progressbar li")
      .eq($("fieldset").index(current_fs))
      .removeClass("active");

    //show the previous fieldset
    previous_fs.show();
    //hide the current fieldset with style
    current_fs.animate(
      { opacity: 0 },
      {
        step: function (now, mx) {
          //as the opacity of current_fs reduces to 0 - stored in "now"
          //1. scale previous_fs from 80% to 100%
          scale = 0.8 + (1 - now) * 0.2;
          //2. take current_fs to the right(50%) - from 0%
          left = (1 - now) * 50 + "%";
          //3. increase opacity of previous_fs to 1 as it moves in
          opacity = 1 - now;
          current_fs.css({ left: left });
          previous_fs.css({
            transform: "scale(" + scale + ")",
            opacity: opacity,
          });
        },
        duration: 800,
        complete: function () {
          current_fs.hide();
          animating = false;
        },
        //this comes from the custom easing plugin
        easing: "easeInOutBack",
      }
    );
  });

  $(".submit").click(function () {
    return false;
  });

  return (
    <div className="request-form">
      <div className="header"></div>

      {/* <!-- MultiStep Form --> */}
      <div className="row">
        <div className="col-md-6 col-md-offset-3">
          <form className="request">
            {/* <!-- progressbar --> */}
            <ul className="progressbar">
              <li className="active">Fish Details</li>
              <li>Auction Method</li>
              <li>Auction Detail</li>
              <li>Preview</li>
            </ul>
            {/* <!-- fieldsets --> */}
            {/* <!-- fieldset1 --> */}
            <fieldset>
              <h2 className="fs-title">Fish Details</h2>
              <h3 className="fs-subtitle">Enter information about Fish</h3>
              <div className="fieldInput">
                <div className="col-md-6">
                  <h5>Fish Name</h5>
                  <input type="text" name="fishName" placeholder="Fish Name" />
                </div>
                <div className="col-md-6">
                  <h5>Fish Name</h5>
                  <input
                    type="text"
                    name="FishShape"
                    placeholder="Fish Shape"
                  />
                </div>
              </div>
              <div className="fieldInput">
                <div className="col-md-6">
                  <h5>Fish Size</h5>
                  <input type="text" name="FishSize" placeholder="Fish Size" />
                </div>
                <div className="col-md-6">
                  <h5>Fish Origin</h5>
                  <input
                    type="text"
                    name="FishOrigin"
                    placeholder="Fish Origin"
                  />
                </div>
              </div>
              <div className="fieldInput">
                <div className="col-md-6">
                  <h5>Fish Age</h5>
                  <input type="text" name="FishAge" placeholder="Fish Age" />
                </div>
                <div className="col-md-6">
                  <h5>Fish Weight</h5>
                  <input
                    type="text"
                    name="FishWeight"
                    placeholder="Fish Weight"
                  />
                </div>
              </div>
              <div className="fieldInput">
                <div className="col-md-6">
                  <h5>Fish Address</h5>
                  <input
                    type="text"
                    name="FondArrdess"
                    placeholder="Fond Arrdess"
                  />
                </div>
                <div className="col-md-6">
                  <h5>Fish City</h5>
                  <input type="text" name="FishCity" placeholder="Fish City" />
                </div>
              </div>
              <div className="fieldInput">
                <div className="col-md-6 gender-group">
                  <div className="gender">Gender:</div>
                  <div className="gender-select">
                    <input
                      type="radio"
                      name="gender"
                      value="female"
                      className="gender-option"
                    />
                    <div>Female</div>
                  </div>
                  <div className="gender-select">
                    <input
                      type="radio"
                      name="gender"
                      value="male"
                      className="gender-option"
                    />
                    <div>Male</div>
                  </div>
                </div>
                <div className="col-md-6"></div>
              </div>
              {/* <!--next form--> */}
              <input
                type="button"
                name="nextButton"
                className="next action-button"
                value="Next"
              />
            </fieldset>
            {/* <!-- fieldset2 --> */}
            <fieldset>
              <h2 className="fs-title">Social Profiles</h2>
              <h3 className="fs-subtitle">
                Your presence on the social network
              </h3>
              <input type="text" name="twitter" placeholder="Twitter" />
              <input type="text" name="facebook" placeholder="Facebook" />
              <input type="text" name="gplus" placeholder="Google Plus" />
              <input
                type="button"
                name="previous"
                className="previous action-button-previous"
                value="Previous"
              />
              <input
                type="button"
                name="next"
                className="next action-button"
                value="Next"
              />
            </fieldset>
            {/* <!-- fieldset3--> */}
            {/* <fieldset>
              <h2 className="fs-title">Social Profiles</h2>
              <h3 className="fs-subtitle">
                Your presence on the social network
              </h3>
              <input type="text" name="twitter" placeholder="Twitter" />
              <input type="text" name="facebook" placeholder="Facebook" />
              <input type="text" name="gplus" placeholder="Google Plus" />
              <input
                type="button"
                name="previous"
                className="previous action-button-previous"
                value="Previous"
              />
              <input
                type="button"
                name="next"
                className="next action-button"
                value="Next"
              />
            </fieldset> */}
            {/* <!-- fieldset4 --> */}
            {/* <fieldset>
              <h2 className="fs-title">Create your account</h2>
              <h3 className="fs-subtitle">Fill in your credentials</h3>
              <input type="text" name="email" placeholder="Email" />
              <input type="password" name="pass" placeholder="Password" />
              <input
                type="password"
                name="cpass"
                placeholder="Confirm Password"
              />
              <input
                type="button"
                name="previous"
                className="previous action-button-previous"
                value="Previous"
              />
              <input
                type="submit"
                name="submit"
                className="submit action-button"
                value="Submit"
              />
            </fieldset> */}
          </form>
        </div>
      </div>
      {/* <!-- /.MultiStep Form --> */}
    </div>
  );
};

export default Request;
